    mx = 1_000_000
    primes = [True] * (mx + 1)
    primes[0] = False
    primes[1] = False
    for p in range(2, int(mx**0.5) + 1):
        if primes[p]:
            for i in range(p * p, mx + 1, p):
                primes[i] = False
